binding.p:
Medieval binding. Brown leather over wooden boards. 4 double raised bands and 2 endbands. 2 hooked clasps.  in brown ink: 230; in black ink on a white label and again stamped in gold underneath: A 50. Former librarian Sten G. Lindberg identified the binding as the work of Archbishop Jakob Ulvsson's bookbinder, active in Uppsala in the 1490s, see The National Library of Sweden, Sten G. Lindbergs arkiv, B 13c Jakob Ulfssons bokbinderi. He is possibly identical to Hans bokabinder, citizen in Uppsala, SDHK, no. 33208; Collijn U 387:22, ‘Bokbindare i Sverige, 1400-talet’; 
                                        Dahlbäck (1991)

                                    .

